import React from "react";

const log = ()=>{

    return(
        <div className = "logDetails">
            <table style={{    justifyContent: "space-around", display: "flex" }}>

                <th>Date</th>
                <th>OUT Time</th> 
                <th>IN Time</th>

            </table>
            <table style={{    justifyContent: "space-around", display: "flex" }}>


                <tr style={{    justifyContent: "space-around", display: "flex" }} >
                <td><span>01/01/2011</span></td>
                <td><span>12:00</span></td>
                <td><span>01:00</span></td>
                </tr>




            </table>

        </div>
    )
}

export default log;
